import React from 'react';
import LessonCard from '../LessonCard';

const PasswordSecurityQuiz = () => {
  return (
    <LessonCard title="Password Security Quiz">
      <ol>
        <li>What is a good strategy for creating strong passwords?</li>
        <li>Why is password reuse risky?</li>
        <li>What tool helps you manage multiple passwords securely?</li>
      </ol>
    </LessonCard>
  );
};

export default PasswordSecurityQuiz;
